const PORT = 8000
const express = require('express')
const request = require("request");
const app = express()
const cors = require('cors')
app.use(cors())

app.get('/', function(req, res) {
    res.json('This is the response xd')
})

app.get('/upload', function (req, res) {

    const options = {
        method: 'POST',
        url: 'https://www.virustotal.com/vtapi/v2/file/scan',
        headers: {accept: 'text/plain', 'content-type': 'application/x-www-form-urlencoded'},
        form: {
            apikey: '6e36fa142ca23dbe4fc603d019b0ba8a6f3d3ca977706dfc52d74698a212f098',
            file: 'data:application/pdf;name=eJPTv2.pdf;base64,'
        }
    };

    request(options, function (error, response, body) {
        if (error) throw new Error(error);

        res.send(body)

    });
})

app.get('/results', function(req, res) {
    const options = {
        method: 'GET',
        url: 'https://www.virustotal.com/vtapi/v2/file/report?apikey=6e36fa142ca23dbe4fc603d019b0ba8a6f3d3ca977706dfc52d74698a212f098&resource=038ad98ea158372e9b98ae22bb8aef5f80db544c6ae2e904d4848e3e01d592df&allinfo=false'
    };

    request(options, function (error, response, body) {
        if (error) throw new Error(error);

        res.send(body);
    });
})

app.listen(PORT, () => console.log(`Server running on port ${PORT}`))